//apply data attributes
function setAttributes(div, attrs) {
  for(var key in attrs) {
    div.setAttribute(key, attrs[key]);
  }
}

//global filter array
let f = {};

//return phunky list
function list(x) { //x is filtered phunk object
	document.getElementById("phunky-list").innerHTML='';
	for(i in x) {
		let mydiv = document.createElement('div');
		mydiv.innerHTML = x[i].html;
		mydiv.classList.add('phunk-wrapper','col-md-2','ib');
		mydiv.setAttribute('onclick','deets(this.id);'); //add onclick
		mydiv.setAttribute('id', x[i].tokenId); //set id === token id
		setAttributes(mydiv, JSON.parse(x[i].data));
		document.getElementById("phunky-list").appendChild(mydiv);
	}
}

//add trait filter
function trait(x) {
	let attr = document.getElementById(x).getAttribute('name');
	let val = document.getElementById(x).value;
	f[attr] = val;
	let ps = phunky.filter(i => Object.entries(f).every(([k, v]) => i[k] === v));
	list(ps);
	console.log(ps);
}

//clear trait filter
function cleer(c) {
	delete f[c];
	console.log(f);
	let ps = phunky.filter(i => Object.entries(f).every(([k, v]) => i[k] === v));
	list(ps);
	console.log('clear script completed');
}
